import React from 'react'
import { useState } from 'react'
function List({Employees,setEmployees}) {
  const [Name, setName] = useState('');
  const [Email, setEmail] = useState('');
  const [Pnumber, setPnumber] = useState(null);
  const [Date, setDate] = useState(null);

  const handleadd = (e) =>{
    e.preventDefault();
    const newEmployee =  {Name,Email,Pnumber,Date};
    
    Employees.push(newEmployee);
    setEmployees(Employees);
  }
console.log(Employees);
  return (

    <section>
      <div className='container'>
        <div className='form-group' onSubmit={handleadd}>
          <div className='row'>
            <div className='col-lg-6'>

              <label>Name</label>
              <input type='name' className='form-control' value={Name} onChange={(e)=>setName(e.target.value)} ></input>

              <label>Email</label>
              <input type='Email' className='form-control' value={Email} onChange={(e)=>setEmail(e.target.value)} ></input>

              <label>Phone Number</label>
              <input type='number' className='form-control' value={Pnumber} onChange={(e)=>setPnumber(e.target.value)} ></input>

              <label>Date</label>
              <input type='Date' className='form-control' value={Date} onChange={(e)=>Date(e.target.value)} ></input>
           
            </div>



          </div>
        </div>


      </div>


    </section>


  )
}

export default List
